window.bookSummaryJSON = "<p><b>The first three novels and the prequel novella in the million-selling Nate Temple Series: </b><b><i>Obsidian Son</i></b><b>, </b><b><i>Blood Debts</i></b><b>, </b><b><i>Grimm</i></b><b>, and </b><b><i>Fairy Tale</i></b><b>.</b></p> <p>My name is Nate Temple, and I’m secretly a wizard.</p> <p>I ride a foul-mouthed unicorn, I drink with Achilles, and I’m pals with the Four Horsemen. I’ve even cow-tipped the Minotaur. I understand the theory of following the rules...I’m just not very good at the application.</p> <p>Because rules were meant to be broken, and St. Louis has a bit of a supernatural infestation these days. Someone should probably be keeping an eye on these things -and probably an eye on me, too. Before I blow up another building...or three.</p>"; 
